import React from 'react'
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';

const Home = ({user}) => {
  return (


            <div>

                {(user.username != "") ? (<div className="welcome">Welcome, <span>{user.username}</span>
                    </div> 
                ) : (
                    <Routes>
                        <Route element={<Navigate to="/Login"/>}/>
                    </Routes>


                )}

                <h1>Home page</h1>

            </div>



  )
}

export default Home
